  true,\n\t\"url\": null,\n\t\"notes\": \"The Residential Energy Consumption Survey
  (RECS) is a national survey that collects residential energy-related data. The 2005
  survey collected data from 4,381 households in housing units statistically selected
  to represent the 111.1 million housing units in the U.S. Data were obtained from
  residential energy suppliers for each unit in the sample to produce the Consumption
  & Expenditures data. The Consumption & Expenditures and Intensities data is divided
  into two parts: Part 1 provides energy consumption and expenditures by census region,
  population density, climate zone, type of housing unit, year of construction and
  ownership status; Part 2 provides the same data according to household size, income
  category, race and age. The next update to the RECS survey (2009 data) will be available
  in 2011.\",\n\t\"license_title\": \"Creative Commons Attribution\",\n\t\"extras\":
